import React from 'react';

const Dashboard = () => {
  return (
    <div className="p-4">
      <h1 className="text-3xl font-bold mb-4">Bienvenue dans le Dashboard</h1>
      <p>Ceci est une page protégée après connexion.</p>
    </div>
  );
};

export default Dashboard;
